const Home = () => {
    return ( 
        <div className="Home">
            
        </div>
     );
}
import Navbar from './Navbar';
import Race from './Race';
import React, { useEffect, useState } from "react";
import '../App.css';
import MyProfile from './MyProfile';

function UpcomingRaces() {

  const restURL = "http://localhost:8081/race/rest/races/";
  const [races, setRaces] = useState([])
  const [RaceDetails, setRaceDetails] = useState([])


  const fetchData = () => {
    fetch(restURL, {
      headers: {
        mode: 'no-cors',
        method: "GET",
        'Content-Type': 'application/json',
      }
    })
      .then(response => {
        return response.json()
      })
      .then(data => {
        setRaces(data)
      })
  }

  useEffect(() => {
    fetchData()
  }, [])

  let raceList = [];
  races.forEach(race => {
    raceList.push(
      <Race data={race} 
      onClickDetails={setRaceDetails}/>
    )
  });

  return (
    <div className="Page">
    <div className="App">
      <div className="main">
          <MyProfile/>
      </div>
    </div>
    </div>
  );
}

export default Home;
